import React from "react";
import "./Contacts.css";

export const Contact = () => (
  <div class="contact_page">
    <div className="papa_contact text-center">
      <div className="texto_contact">
        <button type="button" class="btn btn-fb">
          <i class="fab fa-facebook-f pr-1"></i> phone
        </button>
        <span>9(999)-99-99</span>
      </div>
    </div>
  </div>
);
